import React from 'react'
function Chopa() {
  return (
    <div>Chopa
      peed boat commonly known as <b>chopa</b> in the region<br/>
      <img src="./images/welcome.jpg" alt="a photo of the speed boat" title="chopa"/>
        <p>the speed boat move from lunda to mbita in a duration of ten to twenty minutes it depends with the power propelling it and it coasts 200ksh<br/> it only carries passangers ,a number of abot ten passangers or less </p>
    </div>
  )
}

export default Chopa;
